import React from "react";
import Header from "../Header";
import { TextField } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { Link } from "react-router-dom";
import './style.css';
import { Button } from "@material-ui/core";
import { useButtonStyles, useTextFieldStyles } from "../../RootStyles";


const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
  }));

export default function Register() {
    const buttonclasses = useButtonStyles();
    const textFieldClasses = useTextFieldStyles();
  return (
      <div className="register">
        <Header></Header>
        <div className="register__form">
        <form className={textFieldClasses.root} noValidate autoComplete="off">
        <h2>Register</h2>
           <TextField fullWidth id="filled-basic" placeholder="you@awesome.com" label="Your Email" variant="outlined" />
           <TextField fullWidth id="filled-basic" placeholder="p@$$w0rd" label="Your Password" variant="outlined"/>
           <Button fullWidth component={Link} className={buttonclasses.secondary} to="/register" color="default" >Register</Button>
       </form>
    </div>
     </div>
  )
}
